import { Button } from '@mui/material';


export default function StatusButton (props){
    const status = props.status;


    if (status=='pending'){
        return(
            <Button variant='contained' style={{backgroundColor:'#DDE378', color:'#7B7E3C', fontStyle:'oblique'}}>Pending</Button>

        );
    }
}
